sectionA:Button("roblox king legacy auto farm", function()
 -- This script is in development which are unfinished 
-- anyway you still can use this
local Players = game:GetService("Players")
local Workspace = game:GetService("Workspace")
local ReplicatedStorage = game:GetService("ReplicatedStorage")

local autoFarmActive = {}
local autoFarmClickActive = false

local function teleportToNPC(npcName)
    local localplayer = Players.LocalPlayer
    local localplayerHandle = localplayer.Character and localplayer.Character:FindFirstChild("HumanoidRootPart")

    if not localplayerHandle then return end

    for _, v in ipairs(Workspace:GetDescendants()) do
        if v:IsA("Model") and v.Name == npcName and v:FindFirstChild("HumanoidRootPart") and v:FindFirstChild("Humanoid") then
            local mob = v:FindFirstChild("HumanoidRootPart")
            local mob1 = v:FindFirstChild("Humanoid")
            if mob and mob1 and mob1.Health > 0 and localplayerHandle then
                localplayerHandle.CFrame = mob.CFrame * CFrame.new(0, 0, 8)
                return
            end
        end
    end
end

local function autoFarm(npcName, questName, questDetails)
    autoFarmActive[npcName] = true

    while autoFarmActive[npcName] do
        local args = {
            [1] = questName,
            [2] = questDetails
        }
        ReplicatedStorage.Chest.Remotes.Functions.Quest:InvokeServer(unpack(args))
        teleportToNPC(npcName)
        wait(0.1)
    end
end

local function autoFarmClick()
    while autoFarmClickActive do
        local args = {
            [1] = "FS_None_M1"
        }
        ReplicatedStorage.Chest.Remotes.Functions.SkillAction:InvokeServer(unpack(args))
        wait(0.1)
    end
end

